Taking Granor Farm on the road! 

Join me at Sand Valley Resort in Wisconsin “Taste of Traditions”! The event is taking place on the weekend of December 1-3 this holiday season.

I’ll be taking you on a journey to the farm, through our ingredients, sharing recipes and holiday rituals that hold a special place in my heart. From generations-old family dishes to cherished traditions, we’re diving deep into flavors and stories that define who I am. But here’s the kicker - it’s not just me! I’m honored to be a part of this bonkers line up
